import React from 'react'

function ProductList(props) {
    const id_1 = props.productList[0].id
    const id_2 = props.productList[1].id
    const model =(
            props.productList.map((product)=>
                <td key={product.id}>{product.model} </td> 
            )
    );

    const price =(
            props.productList.map((product)=>
                <td key={product.id}>{product.price}</td>
                )
    );
    
    const quantity=(
        props.productList.map((product)=>
        <td key={product.id}>{product.quantity}</td>
        )
    )
    
    return (
        <table>
            <tr>
                <th>
                    Name
                </th>
                {model}
            </tr> 
            <tr>
                <th>
                    Price
               </th>
               {price}
            </tr>
            <tr>
                <th>
                    Quantity
                </th>
                {quantity}
            </tr>
            <tr>
                <th>
                    No of Items
                </th>
                <td>
                    <button onClick={(id)=>{props.incrementQuantity(id)}}>+</button>
                    <button>-</button>
                </td>
                <td>
                    <button>+</button>
                    <button>-</button>
                </td>
            </tr>
        </table>
    )
            
        
    
}

export default ProductList
